import React from "react";
import Navbar from "./Navbar.js";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="users">
        <div>
          <img src="https://reqres.in/img/faces/2-image.jpg" />
        </div>
        <div>
          <p className="id">2</p>
          <p className="f_name">Janet</p>
          <p className="l_name">Weaver</p>
          <p className="email">janet.weaver@reqres.in</p>
        </div>
      </div>
    </div>
  );
}

export default App;
